import React,{Component} from "react";
import Header from "./Header";
import List from "./List";
import './App.css'


export default class Todo extends Component {

    //获取一个todo
    addtodo = () =>{
        console.log('我是addtodo');
    }

    render() {
        return(
            <div className="todo-cell">
                <Header addtodo={this.addtodo}/>
                <List />
            </div>
        )
    }
}
